script: |
  super -f tsv -I q8509.sql | sort > q8509.out

vector: true

inputs:
  - name: q8509.sql
    data: |
      SELECT ALL - 64 - + CAST ( + COUNT ( * ) AS INTEGER ) FROM tab1 AS cor0 WHERE NOT - col2 BETWEEN NULL AND - 89 * - + col1;
  - name: tab1

outputs:
  - name: q8509.out
    data: |
      -64
